import React, { useState } from 'react';
import styled from 'styled-components';

const InstructionsContainer = styled.div`
  background-color: rgba(44, 62, 80, 0.9);
  padding: 20px;
  border-radius: 5px;
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  z-index: 1000;
  max-width: 80%;
  max-height: 80%;
  overflow-y: auto;
  box-shadow: 0 0 20px rgba(0, 0, 0, 0.5);
`;

const InstructionsHeader = styled.h2`
  color: #fff;
  margin-bottom: 15px;
  text-align: center;
`;

const CloseButton = styled.button`
  position: absolute;
  top: 10px;
  right: 10px;
  background-color: #e74c3c;
  &:hover {
    background-color: #c0392b;
  }
`;

const InstructionSection = styled.div`
  margin-bottom: 20px;
`;

const SectionTitle = styled.h3`
  color: #3498db;
  margin-bottom: 10px;
`;

const InstructionsList = styled.ul`
  margin-left: 20px;
`;

const InstructionItem = styled.li`
  margin-bottom: 8px;
  line-height: 1.5;
`;

const HelpButton = styled.button`
  position: fixed;
  bottom: 20px;
  right: 320px;
  background-color: #f39c12;
  &:hover {
    background-color: #d35400;
  }
`;

function Instructions({ isOpen, onClose }) {
  if (!isOpen) {
    return <HelpButton onClick={onClose}>Instructions</HelpButton>;
  }

  return (
    <>
      <InstructionsContainer>
        <CloseButton onClick={onClose}>X</CloseButton>
        <InstructionsHeader>How to Play</InstructionsHeader>
        
        <InstructionSection>
          <SectionTitle>Basic Controls</SectionTitle>
          <InstructionsList>
            <InstructionItem>Click on a land tile to interact with it using the selected tool</InstructionItem>
            <InstructionItem>Use the tool buttons to select your current action</InstructionItem>
            <InstructionItem>Manage your resources and expand your farm</InstructionItem>
          </InstructionsList>
        </InstructionSection>
        
        <InstructionSection>
          <SectionTitle>Farming</SectionTitle>
          <InstructionsList>
            <InstructionItem>First, use the Plow tool to prepare your land</InstructionItem>
            <InstructionItem>Then, use the Plant tool to plant crops on plowed land</InstructionItem>
            <InstructionItem>Wait for crops to grow (indicated by color change)</InstructionItem>
            <InstructionItem>Use the Harvest tool to collect mature crops</InstructionItem>
            <InstructionItem>Sell your crops at the Market for money</InstructionItem>
          </InstructionsList>
        </InstructionSection>
        
        <InstructionSection>
          <SectionTitle>Technology</SectionTitle>
          <InstructionsList>
            <InstructionItem>Unlock new technologies in the Tech Tree</InstructionItem>
            <InstructionItem>Technologies provide new abilities and upgrades</InstructionItem>
            <InstructionItem>Land Expansion increases your farm size</InstructionItem>
            <InstructionItem>Advanced Crops unlocks more profitable plants</InstructionItem>
            <InstructionItem>Automation makes farming more efficient</InstructionItem>
          </InstructionsList>
        </InstructionSection>
        
        <InstructionSection>
          <SectionTitle>Python Console</SectionTitle>
          <InstructionsList>
            <InstructionItem>Use the Python console to write and execute code</InstructionItem>
            <InstructionItem>Code can be used to automate tasks or unlock special features</InstructionItem>
            <InstructionItem>Try simple commands to learn how it works</InstructionItem>
          </InstructionsList>
        </InstructionSection>
      </InstructionsContainer>
      <HelpButton onClick={onClose}>Close Instructions</HelpButton>
    </>
  );
}

export default Instructions;
